use dep::std::wrapping_sub;
use crate::rlp::types::{RlpList, RlpFragment, RlpHeader, STRING, LIST};
use crate::misc::fragment::Fragment;

// Maximum number of bytes required to represent entity length.
// This means that this library can only decode RLP entities with a length of up to 2^16 - 1 bytes.
global MAX_LEN_IN_BYTES: u32 = 2;

pub fn extract_payload_len<let N: u32>(data: Fragment<N, u8>, lenlen: u32) -> u32 {
    assert(lenlen <= MAX_LEN_IN_BYTES, "Length of length exceeds maximum");
    assert(lenlen <= data.length, "Length of length exceeds input length");
    assert(lenlen != 0, "Length of length is zero");

    let mut payload_length = 0;

    for i in 0..MAX_LEN_IN_BYTES {
        if (i < lenlen & i < data.length) {
            payload_length = data.at(i) as u32 + payload_length * 256;
        }
    }

    payload_length
}

pub fn decode_to_rlp_header<let N: u32>(data: Fragment<N, u8>) -> RlpHeader {
    let mut data = data;
    let prefix = data.pop_front();

    if (prefix < 0x80) { // single byte
        RlpHeader { offset: 0, length: 1, data_type: STRING }
    } else if (prefix < 0xb8) { // [0, 55] byte string
        let offset = 1;
        let length = wrapping_sub(prefix, 0x80) as u32;
        assert(offset + length <= N, "Decoded length of short string exceeds input length");

        RlpHeader { offset, length, data_type: STRING }
    } else if (prefix < 0xc0) { // > 55 byte string
        let offset = wrapping_sub(1 + prefix, 0xb7) as u32;
        let length = extract_payload_len(data, wrapping_sub(prefix, 0xb7) as u32);
        assert(offset + length <= N, "Decoded length of long string exceeds input length");

        RlpHeader { offset, length, data_type: STRING }
    } else if (prefix < 0xf8) { // [0, 55] byte list
        let offset = 1;
        let length = wrapping_sub(prefix, 0xc0) as u32;
        assert(offset + length <= N, "Decoded length of short list exceeds input length");

        RlpHeader { offset, length, data_type: LIST }
    } else { // > 55 byte list
        let offset = wrapping_sub(1 + prefix, 0xf7) as u32;
        let length = extract_payload_len(data, wrapping_sub(prefix, 0xf7) as u32);
        assert(offset + length <= N, "Decoded length of long list exceeds input length");

        RlpHeader { offset, length, data_type: LIST }
    }
}

pub fn decode_string<let N: u32>(input: Fragment<N, u8>) -> RlpFragment {
    let mut RlpHeader {offset, length, data_type} = decode_to_rlp_header(input);
    assert(data_type == STRING, "Wrong data type");

    let total_len = length + offset;
    assert(total_len <= input.length, "Total length exceeds input length");

    RlpFragment { offset, length, data_type: STRING }
}

// Strings are decoded and offsets point to the start of raw values, while list offsets point to the start of the RLP header.
pub fn decode_list<let N: u32, let MAX_FIELDS: u32>(data: Fragment<N, u8>) -> RlpList<MAX_FIELDS> {
    let mut rlp_list: RlpList<MAX_FIELDS> = BoundedVec::new();

    let RlpHeader {offset, length, data_type} = decode_to_rlp_header(data);
    assert(data_type == LIST, "Expected a list");

    let total_len = length + offset;
    assert(total_len <= data.length, "Total length exceeds input length");

    let mut current_offset = offset;
    for _ in 0..MAX_FIELDS {
        if (current_offset < total_len) {
            let header: Fragment<N, u8> = data.subfragment(current_offset, data.length - current_offset);

            let RlpHeader {offset: field_off, length: field_len, data_type: field_type} = decode_to_rlp_header(header);

            let mut offset = current_offset;
            let mut length = field_len;
            if (field_type == STRING) {
                offset += field_off;
            } else {
                length += field_off;
            }

            rlp_list.push(RlpFragment { offset, length, data_type: field_type });

            current_offset += field_off + field_len;
        }
    }
    assert(current_offset == total_len, "Inconsistent rlp length");

    rlp_list
}

// The version of decode_list that is cheaper to call, but only works for lists of small strings (<= 55 bytes).
pub fn decode_list_of_small_strings<let N: u32, let NUM_FIELDS: u32>(data: Fragment<N, u8>) -> RlpList<NUM_FIELDS> {
    let mut rlp_list: RlpList<NUM_FIELDS> = BoundedVec::new();

    let RlpHeader {offset, length, data_type} = decode_to_rlp_header(data);
    assert(data_type == LIST, "Expected a list");

    let total_len = length + offset;
    assert(total_len <= data.length, "Total length exceeds input length");

    let mut current_offset = offset;
    for _ in 0..NUM_FIELDS {
        if (current_offset < total_len) {
            let first_byte = data.at(current_offset);

            let (field_off, field_len) = get_small_string_offset_and_length(first_byte);
            rlp_list.push(RlpFragment { offset: current_offset + field_off, length: field_len, data_type: STRING });

            current_offset += field_off + field_len;
        }
    }
    assert(current_offset == total_len, "Inconsistent rlp length");

    rlp_list
}

pub fn get_small_string_offset_and_length(first_byte: u8) -> (u32, u32) {
    assert(first_byte < 0xb8, "Element is not a string of length < 56 bytes");

    if (first_byte < 0x80) {
        (0, 1)
    } else {
        (1, wrapping_sub(first_byte as u32, 0x80))
    }
}

208.source:
use crate::account::{MAX_ACCOUNT_DEPTH_NO_LEAF_M, MAX_ACCOUNT_LEAF_LEN, MAX_ACCOUNT_STATE_LEN};
use crate::header::{BlockHeaderPartial, get_header};
use crate::merkle_patricia_proofs::proof::ProofInput;
use crate::misc::{
    bytes::right_pad,
    fragment::Fragment,
    types::{Address, Bytes32, BYTES32_LENGTH, HASH_LEN},
};
use crate::rlp::decode::decode_string;
use crate::serde::Serde;
use crate::verifiers::account::verify_account;
use crate::verifiers::storage::verify_storage_values;

use dep::std::hash::keccak256;

global MAX_KEY_LEN: u32 = 32;
global MAX_PREFIXED_KEY_NIBBLE_LEN: u32 = 66; // (MAX_KEY_LEN + 1) * 2
global MAX_STORAGE_DEPTH_NO_LEAF_M = 7; // Emperically correct values to be determined after we scan ethereum state trie.

global MAX_STORAGE_VALUE_LEN: u32 = 32; // Values taken from storageProofConfig in storage.ts.
global MAX_STORAGE_LEAF_LEN: u32 = 69;

struct Account {
    nonce: u64,
    balance: Field,
    storage_root: Bytes32,
    code_hash: Bytes32,
}

impl Eq for Account {
    fn eq(self, other: Self) -> bool {
        (self.nonce == other.nonce)
            & (self.balance == other.balance)
            & (self.storage_root == other.storage_root)
            & (self.code_hash == other.code_hash)
    }
}

// For now oracle does not support returning array of arrays so at the moment we support only one storage proof.
// When https://github.com/noir-lang/noir/issues/4498 is resolved we can change to `StateAndStorageProof<N>` and `storage_proof: [StorageProof; N]`.
struct StateAndStorageProofInput {
    account: Account,
    state_proof_input: ProofInput<MAX_PREFIXED_KEY_NIBBLE_LEN, MAX_ACCOUNT_STATE_LEN, MAX_ACCOUNT_DEPTH_NO_LEAF_M, MAX_ACCOUNT_LEAF_LEN>,
    storage_proof_input: ProofInput<MAX_PREFIXED_KEY_NIBBLE_LEN, MAX_STORAGE_VALUE_LEN, MAX_STORAGE_DEPTH_NO_LEAF_M, MAX_STORAGE_LEAF_LEN>,
}

struct StorageWithinBlock<let N: u32> {
    block_hash: Bytes32,
    account: Account,
    values: [Bytes32; N],
}

type ProofInputSerialized<let LEN: u32> = [Field; LEN];

impl Eq for StorageWithinBlock<1> {
    fn eq(self, other: Self) -> bool {
        (self.block_hash == other.block_hash)
            & (self.account == other.account)
            & (self.values[0] == other.values[0])
    }
}

fn assert_storage_key_equals(
    storage_key: Bytes32,
    storage_key_hash: [u8; MAX_PREFIXED_KEY_NIBBLE_LEN],
) {
    let storage_key_hash_fragment = Fragment::new(
        MAX_PREFIXED_KEY_NIBBLE_LEN - HASH_LEN,
        HASH_LEN,
        storage_key_hash,
    );
    let other_storage_key_hash_fragment =
        Fragment::from_array(keccak256(storage_key, BYTES32_LENGTH as u32));
    assert(
        storage_key_hash_fragment.eq(other_storage_key_hash_fragment),
        "Storage key does not match the argument",
    );
}

fn get_fragment<let N: u32>(left_padded_value: [u8; N]) -> Fragment<N, u8> {
    let value_len = right_pad(left_padded_value).len();
    let value_offset = N - value_len;
    Fragment::new(value_offset, value_len, left_padded_value)
}

fn get_storage_value(
    rlp_encoded_value: [u8; MAX_STORAGE_VALUE_LEN],
) -> [u8; MAX_STORAGE_VALUE_LEN] {
    let mut storage_value = get_fragment(rlp_encoded_value);
    let rlp_fragment = decode_string(storage_value);
    let rlp_header_len = rlp_fragment.offset;

    // Storage value is maximum 32 bytes long, so its RLP-encoding's header is maximum 1 byte long.
    assert(rlp_header_len <= 1, "Expected RLP header to be maximum 1 byte long");
    if rlp_fragment.offset == 1 {
        let rlp_header_position = storage_value.offset;
        storage_value.data[rlp_header_position] = 0;
    }

    storage_value.data
}

pub fn get_account_with_storage(
    chain_id: Field,
    block_number: u64,
    address: Address,
    storage_key: Bytes32,
) -> StorageWithinBlock<1> {
    let BlockHeaderPartial { number: _, hash, state_root, transactions_root: _, receipts_root: _ } =
        get_header(chain_id, block_number);
    let StateAndStorageProofInput { account, state_proof_input, storage_proof_input } =
        get_proof_unconstrained(chain_id, block_number, address, storage_key);

    verify_account(address, account, state_proof_input, state_root);
    // verify_storage_values([storage_proof_input], account.storage_root);

    assert_storage_key_equals(storage_key, storage_proof_input.key);

    StorageWithinBlock {
        block_hash: hash,
        account,
        values: [get_storage_value(storage_proof_input.value)],
    }
}

#[oracle(get_proof)]
unconstrained fn get_proof_oracle<let STATE_PROOF_INPUT_LEN: u32, let STORAGE_PROOF_INPUT: u32>(
    _chain_id: Field,
    _block_no: u64,
    _address: Address,
    _storage_key: Bytes32,
    ) -> (Account, ProofInputSerialized<STATE_PROOF_INPUT_LEN>, ProofInputSerialized<STORAGE_PROOF_INPUT>) {}

unconstrained fn get_proof_unconstrained(
    chain_id: Field,
    block_no: u64,
    address: Address,
    storage_key: Bytes32,
) -> StateAndStorageProofInput {
    let (account, state_proof_input, storage_proof_input) =
        get_proof_oracle(chain_id, block_no, address, storage_key);
    let state_proof_input = Serde::deserialize(state_proof_input);
    let storage_proof_input = Serde::deserialize(storage_proof_input);

    StateAndStorageProofInput { account, state_proof_input, storage_proof_input }
}

